export default (state = null, action) => {
    if(action.type === 'ON_MAIN')
        return 'main';
    if(action.type === 'ON_LOCATION_MAP')
        return 'locationMap';
    if(action.type === 'OFF_PA')
        return 'locationMap';
    else return state;
}
